window.bookSummaryJSON = "<p><b>Savannah is beautiful. Brilliant. Brighter than a ray of sunshine.</b></p> <p>She's also way too young for me and practically family.</p> <p>But she's in trouble.</p> <p>When she witnesses a murder at the hands of a rival mafia, Savannah flees to the only safe refuge she knows—my family.</p> <p>My life is ordered. Careful. Disciplined. But when Savannah needs protection, I can't turn her away.</p> <p>I offer her a deal: I'll take her into my custody. Hide her in plain sight at Le Luxe, the club I own and operate for those who understand the pleasure that comes with total surrender.</p> <p>I'll keep her safe, no matter the cost.</p> <p>In return, she'll follow my rules. Masquerade as the perfect submissive.</p> <p>Obey me.</p> <p>Our ruse might save her life… but will it save her from me?</p> <p><i>This is a dark, anti-hero romance with elements of violence and consensual non-consent.</i> Master Me <i>is a standalone novel in Jane Henry's new series, Masters of Corsica.</i></p>"; 
